import React from 'react';
import {
  QueryClient,
  QueryClientProvider,
} from '@tanstack/react-query';
import './App.css';
import StreamList from './StreamList';

const queryClient = new QueryClient()


function App() {

  return (
    <QueryClientProvider client={queryClient}>
    <div className="App">
     <StreamList/>
    </div>
    </QueryClientProvider>

  );
}

export default App;
